import React, { Component } from "react";
import axios from "axios";

import { Link } from "react-router-dom";
import Nav from "./Nav";

class Doctors extends Component {
    constructor() {
        super();
        this.state = {
            doctorlist: [],

        }
    }




    async componentDidMount() {
        this.setState({ loading: true });
        const response = await axios.get('http://localhost:8080/hospitalApp/doctor/all') // GET meth
        console.log(response.data);
        this.setState({
            loading: false,
            doctorlist: response.data
        })
        console.log(this.state.doctorlist)
    }


    render() {

        const { doctorlist } = this.state;
        return (
            <div>
                <Nav />

                <div>
                    {this.state.loading &&
                        <div class="d-flex justify-content-center">
                            <div class="spinner-border" role="status">
                                <span class="sr-only">Loading...</span>
                            </div>
                        </div>}
                </div>
                <div className="doc-button">
                    <Link to="/Doctorform" type="button" className="btn btn-primary mx-5 mt-1 ">Add Doctor</Link>
                </div>
                <div className="doctorlist">
                    <table className="table table-striped">

                        <thead>
                            <tr>
                                <td ><b>view</b></td>
                                <td ><b>First</b></td>
                                <td ><b>Last</b></td>
                                <td ><b>Specialization</b></td>

                                <td ><b>Available</b></td>

                                <td ><b>Mobile</b></td>

                            </tr>
                        </thead>

                        <tbody>

                            {doctorlist.map((doctor, key) => {
                                return (
                                    <tr>

                                        <td><svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-box-arrow-up-right text-primary" viewBox="0 0 16 16">
                                            <path fill-rule="evenodd" d="M8.636 3.5a.5.5 0 0 0-.5-.5H1.5A1.5 1.5 0 0 0 0 4.5v10A1.5 1.5 0 0 0 1.5 16h10a1.5 1.5 0 0 0 1.5-1.5V7.864a.5.5 0 0 0-1 0V14.5a.5.5 0 0 1-.5.5h-10a.5.5 0 0 1-.5-.5v-10a.5.5 0 0 1 .5-.5h6.636a.5.5 0 0 0 .5-.5z" />
                                            <path fill-rule="evenodd" d="M16 .5a.5.5 0 0 0-.5-.5h-5a.5.5 0 0 0 0 1h3.793L6.146 9.146a.5.5 0 1 0 .708.708L15 1.707V5.5a.5.5 0 0 0 1 0v-5z" />
                                        </svg></td>
                                        <td>{doctor.fName}</td>
                                        <td>{doctor.lName}</td>
                                        <td>{doctor.specialization}</td>
                                        <td>{doctor.isAvailable.toString()}</td>
                                        <td>{doctor.mobileNum}</td>
                                    </tr>

                                )
                            })}




                        </tbody>
                    </table>
                </div >
            </div >
        );
    }
}


export default Doctors;
